import React, { useEffect, lazy, Suspense } from 'react';
import ReactGA from 'react-ga';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const Changelogs = lazy(() => import('./containers/Changelogs'));
const Home = lazy(() => import('./containers/Home'));
const JobGuide = lazy(() => import('./containers/JobGuide'));
const ScrollToTop = lazy(() => import('./components/ScrollToTop.js'));
const CitiesJobs = lazy(() => import('./containers/CitiesJobs'));
const PrivacyPolicy = lazy(() => import('./containers/PrivacyPolicy'));

const renderLoader = () => <p>Loading</p>;

function AppRouter() {
  useEffect(() => {
    ReactGA.initialize('G-77RRHE6EF1');
    // To Report Page View
    ReactGA.pageview(window.location.pathname + window.location.search);
  }, []);

  return (
    <Suspense fallback={renderLoader()}>
      <Router>
        <ScrollToTop />
        <Switch>
          <Route exact path='/' component={Home} />
          <Route exact path='/job-guide/:id' component={JobGuide} />
          <Route exact path='/changelogs' component={Changelogs} />
          <Route exact path='/city/:id' component={CitiesJobs} />
          <Route exact path='/privacy-policy' component={PrivacyPolicy} />

          {/* Personal Information */}
        </Switch>
      </Router>
    </Suspense>
  );
}

export default AppRouter;
